#ver quais os dois criptogramas que s√£o encriptados com a mesma chave
resultado=[]
primeiro=0
while primeiro<20: #percorre os 20 textos (1 a 1)
	segundo=primeiro + 1
	while segundo<20: #percorre cada um dos 20 textos dentro de cada um do while anterior
		resultado.append('\n') #de forma a ter uma quebra de linha em cada texto
		K=list(text[primeiro]) #passar cada string da lista text a lista
		L=list(text[segundo])
		S=[]	
		for i in range(len(K)): #neste for, para cada conjunto de duas listas L e K, faz a "diferen√ßa" entre os textos em m√≥dulo 26.
			s=chr((((ord(K[i])-65) - (ord(L[i])-65))%26)+65) #faz a subtra√ß√£o (modulo 26) entre os carateres.
			S.append(s) #adiciono cada resultado s a uma lista S 
		resultado.append(''.join(S)) #passo cada lista S a string, e fico com uma lista de strings. 
		
		segundo=segundo+1
	primeiro=primeiro+1 

#para c√°lculo dos "A" em cada texto:
i=0
while i < len(resultado):
	if resultado[i] != '\n': #as listas de strings est√£o separados por uma quebra de linha (feito em cima)
		string=resultado[i] 
		ocorrencia={'A':0} #dicionario que mostra as ocorrencias de A em cada texto
		for b in string:
			if (b=='A'):
				ocorrencia[b]=ocorrencia[b]+1 #conta os "A" e vai adicionando ao dicion√°rio
		lista=list(ocorrencia.items())
		print(lista) #mostra as ocorrencias de "A" em cada texto
	i=i+1

with open("resultado.txt",'w') as f1:
	f1.write(''.join(resultado)) #para escrever num ficheiro, tenho que passar a lista de strings a um conjunto de strings. 